import React, { Component } from "react";
import axios from "axios";

class Ambulances extends Component {
  state = {
    ambulances: [],
  };

  async componentDidMount() {
    const { data: ambulances } = await axios.get(
      "http://localhost:3900/api/ambulances"
    );
    this.setState({ ambulances });
  }

  render() {
    return (
      <React.Fragment>
        <table className="table">
          <thead>
            <tr>
              <th>Name</th>
              <th>Email</th>
              <th>Sitting Time</th>
              <th>Qualifications</th>
            </tr>
          </thead>
          <tbody>
            {this.state.ambulances.map((ambulance) => (
              <tr>
                <td>{ambulance.name}</td>
                <td>{ambulance.email}</td>
                <td>{ambulance.sitting_time}</td>
                <td>{ambulance.qualifications}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </React.Fragment>
    );
  }
}

export default Ambulances;
